import Link from 'next/link';

export default function Index() {
  return (

      <div class="container">

        <p id="about">ABOUT</p>
        <div>
          <h1>Code <br /> Blue </h1>
        </div>
        <div>
          <Link href="/menu">
            <a>ENTER</a>
          </Link>
        </div>

      <style jsx>{`

        * { padding: 0; margin: 0 auto; box-sizing: border-box; }

        .container {
          overflow: hidden;
          top: 0;
          right: 0;
          backgroundColor: linear-gradient(to top left, rgba(246, 79, 89, 0.8), rgba(196, 114, 237, 0.8), rgba(18, 194, 233, 0.8));
          display: block;
          width: 100vw;
          height: 100vh;
        }

        #about {
          float: right;
          padding: 25px;
          font-family: Montserrat;
          font-size: 100%;
        }

        h1 { 
          font-family: Raleway; 
          font-size: 800%;
          float: left;
          text-align: left;
          padding-top: 10vh;
          margin-left: 10vw;
          height: 80%;
          padding-bottom: 5vh;
        }

        a { 
          font-family: Montserrat; 
          font-size: 300%; 
          text-decoration: none;
          float: left;
          text-align: left;
          margin-left: 10vw;
          width: 80vw;
        }      
      `}</style>

    </div>
  );
}
